export const processOccupancyData = (data) => {
    console.log("Processing occupancy data...");

    const formattedData = {};
    data.forEach((row) => {
        const year = new Date(row.date).getFullYear();
        if (!formattedData[year]) {
            formattedData[year] = [];
        }
        const point = {
            x: new Date(row.date),
            y: parseFloat(row.average_historical_occupancy),
        };

        formattedData[year].push(point);

        // Log each processed row
        //console.log(`Processed row for year ${year}:`, point);
    });
    console.log("Formatted data:", formattedData); // Log the final formatted data
    return formattedData;
};


export const filterAndProcessData = (data, lgaName) => {
    console.log("Filtering data for LGA:", lgaName);

    if (!data || data.length === 0)  {
        console.log("No data provided or data is empty.");
        return{};
    };

    const filteredData = data.filter(row => row.lga_name === lgaName);
    console.log("Filtered data:", filteredData);

    const formattedData = {};
    filteredData.forEach((row) => {
        const year = new Date(row.date).getFullYear();
        if (!formattedData[year]) {
            formattedData[year] = [];
        }
        const point = {
            x: new Date(row.date),
            y: parseFloat(row.average_historical_occupancy),
        };
        formattedData[year].push(point);
        console.log(`Processed row for year ${year}:`, point);
    });

    console.log("Formatted data after filtering:", formattedData);
    return formattedData;
};
